/*Start our app.js file by listening for the document to be ready.*/$(document).ready(function(){$("<select />").appendTo("nav");$("<option />",{selected:"selected",value:"",text:"Go to..."}).appendTo("nav select");$("nav a").each(function(){var e=$(this);$("<option />",{value:e.attr("href"),text:e.text()}).appendTo("nav select")});$("nav select").change(function(){window.location=$(this).find("option:selected").val()})});(function(e){function t(){var t=window.location.hash,n=e('ul.tabs [href*="'+t+'"]'),r=e(t);if(n.length&&!n.hasClass("active")&&r.length){n.closest(".tabs").find(".active").removeClass("active");n.addClass("active");r.show().addClass("active").siblings().hide().removeClass("active")}}e(window).on("hashchange.skeleton",t);t();e(t)})(jQuery);